import React from 'react';

const Suggested = () => {
    return (
        <div className="movie">
            <figure className="movie__poster--wrapper">
                <img className="movie__poster" src="${movie.Poster}" />
            </figure>
            <div className="movie__description">
                <h1 className="movie__title">movie.Title <span className="movie__year">(${movie.Year})</span></h1>
                <div className="movie__info--wrapper">
                    <h2 className="movie__type">movie.Type</h2>
                    <a className="movie__link" target="_blank" href="https://www.imdb.com/title/${movie.imdbID}/">
                        IMDb
                    </a>
                </div>
            </div>
        </div>
    );
}

export default Suggested;
